import React from 'react';
import financialNewYearImage from '../images/f-year-image.png'; // Importing the image
import yourLogoImage from '../images/logo.jpeg'; // Importing your logo image

function MainContent() {
  return (
    <main>
      <div className="header">
        <img src={yourLogoImage} alt="Your Logo" className="logo" />
        <div className="contact-info">
        </div>
      </div>
      <div className="illustration">
        <img
          src={financialNewYearImage}
          alt="Financial New Year"
          style={{ maxWidth: '100%', height: 'auto' }}
        />
      </div>
      <div className="written-content">
        <p>This is some written content after the image.</p>
      </div>
    </main>
  );
}

export default MainContent;
